import React from "react";
import style from "./NavBar.module.css";
import List from "./List";



function NavBar() {
  return (
      
    <div className={style.nav}>
      <List link="My Server" />
      <List link="Recommended" />
      <List link="NA Server" />
    </div>
  );
}

export default NavBar;
